import csv
import re
import pdb
import requests
from lxml import etree
import json
import usaddress


base_url = 'https://www.lafambank.com'

def validate(item):    
    if item == None:
        item = ''
    if type(item) == int or type(item) == float:
        item = str(item)
    if type(item) == list:
        item = ' '.join(item)
    return item.replace('AMP;', '').strip()

def get_value(item):
    if item == None :
        item = '<MISSING>'
    item = validate(item)
    if item == '':
        item = '<MISSING>'    
    return item

def eliminate_space(items):
    rets = []
    for item in items:
        item = validate(item)
        if item != '':
            rets.append(item)
    return rets

def parse_address(address):
    address = usaddress.parse(address)
    street = ''
    city = ''
    state = ''
    zipcode = ''
    for addr in address:
        if addr[1] == 'PlaceName':
            city += addr[0].replace(',', '') + ' '
        elif addr[1] == 'ZipCode':
            zipcode = addr[0].replace(',', '')
        elif addr[1] == 'StateName':
            state = addr[0].replace(',', '')
        else:
            street += addr[0].replace(',', '') + ' '
    return { 
        'street': get_value(street), 
        'city' : get_value(city), 
        'state' : get_value(state), 
        'zipcode' : get_value(zipcode)
    }

def write_output(data):
    with open('data.csv', mode='w') as output_file:
        writer = csv.writer(output_file, delimiter=',', quotechar='"', quoting=csv.QUOTE_ALL)
        writer.writerow(["locator_domain", "location_name", "street_address", "city", "state", "zip", "country_code", "store_number", "phone", "location_type", "latitude", "longitude", "hours_of_operation"])
        for row in data:
            writer.writerow(row)

def fetch_data():
    output_list = []
    url = "https://locations.fult.com/byaff.aspx"
    session = requests.Session()
    headers = {
        'accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8',
        'content-type': 'application/x-www-form-urlencoded',
        'cookie': 'ASP.NET_SessionId=bld344vgt1ibhii3gtdhia33; visid_incap_894396=9pd4ZOaDTcu9ibmiECoHbkcgfV0AAAAAQUIPAAAAAAC2Dzltz/jKDzEIGGttg0R8; incap_ses_899_894396=yadcZCEOGFslFuy+ZOh5DEggfV0AAAAARGXTAz9fXTda+QIngoj+1Q==; __utma=216746635.2129349970.1568481291.1568481291.1568481291.1; __utmc=216746635; __utmz=216746635.1568481291.1.1.utmcsr=(direct)|utmccn=(direct)|utmcmd=(none); __utmt=1; __utmb=216746635.5.10.1568481291',
        'upgrade-insecure-requests': '1',
        'user-agent': 'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/68.0.3440.106 Safari/537.36'
    }
    select = ['3', '6', '16']
    for sel in select:
        data = {
            '__EVENTTARGET': 'ddAffiliate',
            '__EVENTARGUMENT': '',
            '__LASTFOCUS': '',
            '__VIEWSTATE': '',
            '__VIEWSTATEGENERATOR': 'D59C017C',
            '__EVENTVALIDATION': '/wEdAAZDaNMV88uwJjaQjGFAjed9koeiEyQ3Q9ZmY87RIyKeYAsiXS9fXCs95+bsAeYrm8R6bt8qo/3a0j5SnUB5zOJ20QdIhS5CJ6rdlgCRsHIf3qoPlAN1nf5Yd6LU30EHLO09b+mx/BujVfx41bJNnZaeV/AmyjWRBgW2bdzDrEt4vw==',
            'ddAffiliate': sel,
        }
        source = session.post(url, headers=headers, data=data, verify=False).text        
        response = etree.HTML(source)
        store_list = response.xpath('//table[@class="dataTable"]//tbody')
        for store in store_list:
            detail = eliminate_space(store.xpath('.//td[@width="28%"]//text()'))
            output = []
            output.append(base_url) # url
            output.append(validate(detail[0].replace('FULTON BANK: ', ''))) #location name
            phone = ''
            address = ''
            for idx, de in enumerate(detail):
                if 'phone' in de.lower():
                    phone = de.split(':')[1]
                    address = validate(detail[1: idx])
            if phone == '':
                address = validate(detail[1:])
            address = parse_address(address)
            output.append(address['street']) #address
            output.append(address['city']) #city
            output.append(address['state']) #state
            output.append(address['zipcode']) #zipcode
            output.append('US') #country code
            output.append("<MISSING>") #store_number
            output.append(get_value(phone)) #phone
            output.append("Lafayette Ambassador Bank") #location type
            output.append("<MISSING>") #latitude
            output.append("<MISSING>") #longitude
            lobby_hours = []
            window_hours = []
            temp_hours = store.xpath('.//table[@class="hoursTable"]//tr')
            if len(temp_hours) > 0:
                for hour in temp_hours:
                    hour = eliminate_space(hour.xpath('.//text()'))
                    if len(hour) >=2 :
                        lobby_hours.append(hour[0] + ' ' + hour[1])
                    if len(hour) >=3:
                        window_hours.append(hour[0] + ' ' + hour[2])
                store_hours = get_value(validate(lobby_hours) + ' ' + validate(window_hours)).replace('Day', '')
            else:            
                store_hours = get_value(store.xpath('.//td')[-3].xpath('.//text()'))
            output.append(store_hours) #opening hours        
            output_list.append(output)
    return output_list

def scrape():
    data = fetch_data()
    write_output(data)

scrape()
